import {connect} from 'react-redux';
import * as Actions from '../actions';
import App from '../App';

const mapStateToProps = state => ({
    whosOnFirst: state.whosOnFirst,
    time : state.time,
    teamMembers: state.teamMembers,
    circle: state.circle
  });
  const mapDispatchToProps = (dispatch) => ({
    changeTMList: () => dispatch({type: Actions.changeTMList}),
    updateTimer: () => dispatch({type: Actions.changeTimeDelta}),
    updateTM: () => dispatch({type:Actions.changeTeamMember}),
    changeCircle: () => dispatch({type:Actions.changeCircle})

  });

  export default connect(
    mapStateToProps,
    mapDispatchToProps,
  )(App);
